  constructor(props) {
      super(props)};
render(){
return(
    <Carousel>
    {this.props.CarouselItems.map(item => (
      <div>
          <img src={item.imgsrc} />
          <p className={item.className}>{item.caption}</p>
      </div>
    ))}
  </Carousel>

  );
 }
}

export default Carouselg
